import { Grid } from "@mui/material";
import * as React from 'react';
import savingsLogo from "../../img/savings.svg";
function Home() {
  return (
    <Grid container justifyContent="center" alignItems="center">
      <Grid sx={{
        marginTop: '10vh'
      }}>
        <img src={savingsLogo} sx={{
          width: 200, // Defina a largura desejada
          height: 200
        }} alt="Savings Logo" />
      </Grid>
    </Grid>
  );
}

export default Home;
